import React from 'react';
import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';

import styles from './Aboutaone.module.css';

const Education2 = () => {
  return (
    <div>
      <Top />
      <div className={styles.title}>교육 일정 관리</div>
      <div class="container">
        <br />
        공백
        <br />
        <br />
      </div>
      <Bottom />
    </div>
  );
};

export default Education2;
